(function() {
    'use strict';

     //CSDN点击阅读更多
     var e = document.createEvent("MouseEvents");
     e.initEvent("click", true, true);　　
     var readmore = document.querySelector("#mainBox > main > div.hide-article-box.hide-article-pos.text-center > a")　　　 
     readmore && readmore.dispatchEvent(e);　　　
     
     //内容块居中
     var mainBodyDOM = document.querySelector('#mainBox > main')
     var mainBodyDOMWidth = mainBodyDOM.offsetWidth
     var mainBodyDOMNowLeft = mainBodyDOM.getBoundingClientRect().left
     var windowWidth = window.innerWidth
     mainBodyDOM.style.left = `${ (windowWidth - mainBodyDOMWidth)/2 - mainBodyDOMNowLeft}px`    

     var right =  document.querySelector("body > div.main_father.clearfix.d-flex.justify-content-center > div.recommend-right.align-items-stretch.clearfix");
     right && right.parentNode.removeChild(right);
    //删除广告    
    var child = document.querySelector("body > div.pulllog-box");
    child && child.parentNode.removeChild(child);

    var child2 = document.querySelector("#kp_box_476 > div > div.light-box");
    child2 && child2.parentNode.removeChild(child2);

    var child3 = document.querySelector("#inlineFrameExample");
    child3 && child3.parentNode.removeChild(child3);

    var child4 = document.querySelector("#adContent");
    child4 && child4.parentNode.removeChild(child4);

    var child5 = document.querySelector("#asideFooter");
    child5 && child5.parentNode.removeChild(child5);

    var sideBar = document.querySelector('#mainBox > aside');
    sideBar && sideBar.parentNode.removeChild(sideBar);

    var header = document.querySelector("#csdn-toolbar")
    header && header.parentNode.removeChild(header)

    var child6 = document.querySelector("body > div.tool-box.vertical")
    child6 && child6.parentNode.removeChild(child6)
    
    let m_counter = 0
    let m = setInterval( () => {
    	m_counter++
    	if(m_counter > 10) {
    		clearInterval(m)
    		return
    	}
        var child7 = document.querySelector("body > div:nth-child(41) > div")
        child7 && child7.parentNode.removeChild(child7) && clearInterval(m)    
    },3000)
    
    var child8 = document.querySelector("#container")
    child8 && child8.parentNode.removeChild(child8)

    var child9 = document.querySelector("#s_top_wrap")
	child9 && child9.parentNode.removeChild(child9) 
    
    var child10 = document.querySelector("#u_sp")
	child10 && child10.parentNode.removeChild(child10) 

	var child11 = document.querySelector("#s_upfunc_menus")
	child11 && child11.parentNode.removeChild(child11) 

	var child12 = document.querySelector("#bottom_layer")
	child12 && child12.parentNode.removeChild(child12) 

	var child13 = document.querySelector("#su")
	child13 && child13.parentNode.removeChild(child13) 
	
	var child14 = document.querySelector("#lg")
	child14 && child14.parentNode.removeChild(child14) 

	//for google
	var child15 = document.querySelector("#lga")
	child15 && child15.parentNode.removeChild(child15) 

	var child16 = document.querySelector("#prm-pt")
	child16 && child16.parentNode.removeChild(child16) 
	
	var child17 = document.querySelector("#gbw")
	child17 && child17.parentNode.removeChild(child17)

	var child18 = document.querySelector("#hptl")
	child18 && child18.parentNode.removeChild(child18)

	var child19 = document.querySelector("#tsf > div:nth-child(2) > div.A8SBwf > div.FPdoLc.tfB0Bf")
	child19 && child19.parentNode.removeChild(child19)

	var child20 = document.querySelector("#fbarcnt")
	child20 && child20.parentNode.removeChild(child20)

	var child21 = document.querySelector("#viewport")
	child21.style.backgroundImage = `url('data:image/jpeg;base64,')`
	child21.style.backgroundPosition = "center 0"
	child21.style.backgroundRepeat = "no-repeat"
	child21.style.backgroundSize = "cover"

   
})();